import React, { useEffect, useState } from 'react'
import "./css/packStyle.css"
import { Link } from 'react-router-dom'
import axios from 'axios'


export default function Packs() {

      const [packs , setPacks] = useState([])


 async function fetchData() {
    let res = await axios("http://localhost:8000/api/packs");
	const packages = res.data.packs
	setPacks	
  }

      useEffect( () => {
		fetchData()
	  }
       
	  
      , [])



  return (
    <div> 
		            <h2 className='OUR-PACKAGES'>OUR PACKAGES</h2>

<div className='packs-container'>
	
					{/* firstp pack */}
		{
			packs.length>0 &&
			packs.map((p, index)=>{
				return (<div className='pack'>
					<h3 className='packName'>#{p.nomPack} <br/> &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; pack</h3>
					<h2>{p.prixPack} <span> DHS/mois </span> </h2>
					<ul >
						<li>Un plan d'attaque destiné pour <br/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vous (stratégie)</li>
						<li>Suivi de très près grâce à <br/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; notre application</li>
						<li>1 programme de perte de poids, prise de masse </li>
						<li>Des vidéos d'exécution de tous les exercices</li>
						<li>Fitnessmeal (recettes personnalisées en fonction de l'objectif attendu)</li>
					</ul>
					<Link className='pay' to="/payment/packs1">Buy Pack</Link>
			</div>
				)
			})
		}			
		
	
				{/* SEcond pack */}
		
</div>
    </div>
  )
}
